import React from "react";
import App from "./App";
import { Route, Switch } from "react-router-dom";
import Interview from "./Interview";
export default function Home() {
  return (
    <>
      <Switch>
        <App />
        <Route>
          <Interview />
        </Route>
      </Switch>
    </>
  );
}
